import React, {Component} from 'react';
import './App.css';

class App extends Component{

  render(){

    return (


      /* Header Start */
      <header id="header" class="fixed-top">
        <div class="container d-flex align-items-center">

          <h1 class="logo mr-auto"><a href="index.html">BandsInTown</a></h1>

          <nav class="nav-menu d-none d-lg-block">

          </nav>
          <a href="#search-artist" class="get-started-btn scrollto">Search Artist</a>
        </div>
      </header>  /* Header End */






    );

  }

}

export default App;
